import React, { useState } from "react";

import artist from "../images/artist.png";

export default function Portfolio() {
  const [imageState, setImage] = useState("");

  let image = artist;

  return (
    <div className="portfolio">
      <div style={{ flexDirection: "column", flexGrow: 1, width: "33%" }}>
        <ul>
          <li>The Deed</li>
          <li>Anthromes</li>
          <li>Material</li>
          <li onClick={setImage("artist")}>Personal Portfolio</li>
          <li>Simma</li>
          <li>Financial Auralizer</li>
          <li>Just Intonation</li>
        </ul>
      </div>
      <div style={{ flexDirection: "column", flexGrow: 1, width: "33%" }}>
        <img src={image} alt="" width="100%" />
      </div>
      <div style={{ flexDirection: "column", flexGrow: 1, width: "33%" }}>
        DESCRIPTION
      </div>
    </div>
  );
}
